import {BrowserRouter as Router,Switch,Route} from 'react-router-dom'
import './App.css';
import Home from './Pages/Home.js';
import Client from "./Pages/Client";

function App() {
  return (
      <Router>

          <Switch>
              <Route exact path ='/'>
                 <Home />
              </Route>

              <Route exact path = '/Client'>
                 <Client />
              </Route>

              <Route exact path = '/LogIn'>
                  <Client />
              </Route>
          </Switch>

      </Router>


  );
}

export default App;
